import React from 'react';

const LandingPage = ({ name }) => {
  const getTimeOfDay = () => {
    const hour = new Date().getHours();
    if (hour < 12) {
      return 'Good Morning';
    } else if (hour < 18) {
      return 'Good Afternoon';
    } else {
      return 'Good Evening';
    }
  };

  return (
    <div>
      <h2>{`${getTimeOfDay()} Rescuer!`}</h2>
      <p>{`How are you doing today, ${name}?`}</p>

      <nav>
        {/* Add your navigation links here */}
      </nav>
    </div>
  );
};

export default LandingPage;
